import React, { useState, useEffect } from "react";
import { Button, Badge, Input } from "reactstrap";
import { Alert } from "react-bs-notifier";
import { Redirect } from "react-router-dom";

const API_URL = "http://131.181.190.87:3000";
const url = `${API_URL}/rankings`;

function SearchBar(props) {
  const [innerSearch, setInnerSearch] = useState("");
  return (
    <div className="d-flex align-items-center">
      <Input
        type="search"
        name="search"
        id="search"
        aria-labelledby="search-button"
        value={innerSearch}
        onChange={(e) => {
          setInnerSearch(e.target.value);
        }}
      />

      <Button id="search-button" type="button">
        Search
      </Button>
    </div>
  );
}

function Search(){

    const [rowData, setRowData] = useState([]);

    const columns = [
        { headerName: "Year", field: "year", sortable: true, filter: true },
        { headerName: "Rank", field: "rank", sortable: true },
        { headerName: "Score", field: "score", sortable: true },
    ];

    useEffect(() => {
        fetch(url)
          .then((res) => res.json())
          .then((data) =>
            data.map((info) => {
              return {
                year: info.year,
                rank: info.rank,
                score: info.score,
                Country: info.Country,
              };
            })
          )
          .then((info) => setRowData(info));
    });

    return (
        <div className="containcer">
          <div
            className="widgets"
            style={{ display: "inline-flex", margin: "10px" }}
          >
            <p className="mr-3">
              <Badge color="success">{rowData.length}</Badge> Stocks are found
            </p>
            <SearchBar />
          </div>
          <div
            className="ag-theme-balham"
            style={{
              height: "600px",
              width: "800px",
              margin: "auto",
            }}
          >
            <AgGridReact
              columnDefs={columns}
              rowData={rowData}
              pagination={true}
              paginationPageSize={15}
            />
          </div>
        </div>
      );





}

export default Search;
